import React from 'react'

function Palette() {

  let paletteMethod = 4

  switch(paletteMethod) {
    case 2:
      return (
        <div>
          <div></div>
          <div></div>
        </div>
      )
      break;
    case 3:
      return (
        <div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      )
      break;
    case 4:
      return (
        <div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      )
      break;
    case 5:
      return (
        <div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      )
      break;
    default:
      return (
        <div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      )
    }
}

export default Palette;
